import React, { useEffect, useState } from "react";
import { fetchTrades, fetchCash } from "./ApiCalls";

const Details = () => {
  const [tradeMetrics, setTradeMetrics] = useState(null);
  const [initialCash, setInitialCash] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  // Fetch trades from the API
  useEffect(() => {
    const fetchTradeMetrics = async () => {
      try {
        const trades = await fetchTrades();
        const metrics = calculateTradeMetrics(trades);
        setTradeMetrics(metrics);
        setLoading(false);
      } catch (error) {
        setError(error.message);
        setLoading(false);
      }
    };

    fetchTradeMetrics();
  }, []);

  // Fetch initial cash from the API
  useEffect(() => {
    const fetchInitialCash = async () => {
      try {
        const cashEntries = await fetchCash();
        setInitialCash(cashEntries);
      } catch (error) {
        setError(error.message);
      }
    };

    fetchInitialCash();
  }, []);

  //Metrics
  const calculateTradeMetrics = (trades) => {
    // let totalProfitLoss = 0;
    // let winCount = 0;
    // let lossCount = 0;
    // let biggestWin = null;
    // let biggestLoss = null;
    // let totalReturn = 0;
    // let totalTradeSize = 0;
    // let totalHoldingPeriod = 0;

    // trades.forEach((trade) => {
    //   const profitLoss = trade.profitLoss;
    //   totalProfitLoss += profitLoss * trade.contracts;
    //   totalReturn += (trade.exitPrice - trade.entryPrice) * trade.contracts;
    //   totalTradeSize += trade.contracts;
    //   const holdingPeriod =
    //     new Date(trade.closeDate) - new Date(trade.entryDate);
    //   totalHoldingPeriod += holdingPeriod;
    //   biggestWin = profitLoss * trade.contracts;
    //   biggestLoss = profitLoss * trade.contracts;

    // if (profitLoss > 0) {
    //   winCount++;
    //   if (!biggestWin || profitLoss > biggestWin) {
    //     biggestWin = profitLoss * trade.contracts;
    //   }
    // } else {
    //   lossCount++;
    //   if (!biggestLoss || profitLoss < biggestLoss) {
    //     biggestLoss = profitLoss * trade.contracts;
    //     console.log(profitLoss, trade.contracts);
    //   }
    // }
    // });

    const averageReturn = (totalReturn / trades.length).toFixed(2);
    const winLossRatio = (winCount / trades.length).toFixed(2);
    const profitFactor = (totalProfitLoss / (lossCount || 1)).toFixed(2);
    const averageTradeSize = Math.round(totalTradeSize / trades.length);
    const averageHoldingPeriod =
      totalHoldingPeriod / trades.length / (1000 * 60 * 60 * 24); // in days

    return {
      totalProfitLoss,
      winLossRatio,
      averageReturn,
      biggestWin,
      biggestLoss,
      averageTradeSize,
      averageHoldingPeriod,
      numberOfTrades: trades.length,
      profitFactor,
    };
  };

  if (loading) {
    return <p style={{ fontSize: "10px" }}>Loading...</p>;
  }

  if (error) {
    return <p style={{ fontSize: "10px" }}>Error: {error}</p>;
  }

  return (
    <div className="detailss">
      <div className="header">Analysis</div>
      <div className="metrics">
        <div className="metric">
          <span>Initial:</span>
          <span>
            {initialCash.map((entry) => (
              <div key={entry.id}>${entry.id.toFixed(2)}</div>
            ))}
          </span>
        </div>{" "}
        <div className="metric">
          <span>Cash:</span>
          <span>
            {initialCash.length > 0
              ? `$${(
                  initialCash[0].id +
                  tradeMetrics.totalProfitLoss * 100
                ).toFixed(2)}
                `
              : ""}
          </span>
        </div>
        <div className="metric">
          <span>Trades:</span>
          <span>{tradeMetrics.numberOfTrades}</span>
        </div>
        <div className="metric">
          <span>P/L:</span>
          <span>${(tradeMetrics.totalProfitLoss * 100).toFixed(2)}</span>
        </div>
        <div className="metric">
          <span>Win Rate:</span>
          <span>{(tradeMetrics.winLossRatio * 100).toFixed(2)}%</span>
        </div>
        <div className="metric">
          <span>Avg. return:</span>
          <span>${(tradeMetrics.averageReturn * 100).toFixed(2)}</span>
        </div>
        <div className="metric">
          <span>Top Win:</span>
          <span>${(tradeMetrics.biggestWin * 100).toFixed(2)}</span>
        </div>
        <div className="metric">
          <span>Top Loss:</span>
          <span>${(tradeMetrics.biggestLoss * 100).toFixed(2)}</span>
        </div>
        <div className="metric">
          <span>Sizing:</span>
          <span>{tradeMetrics.averageTradeSize}</span>
        </div>
        <div className="metric">
          <span>Days:</span>
          <span>{Math.round(tradeMetrics.averageHoldingPeriod)}</span>
        </div>
        {/* <div className="metric">
          <span>Profit Factor:</span>
          <span>{tradeMetrics.profitFactor}</span>
        </div> */}
      </div>
    </div>
  );
};

export default Details;
